115891989\", \"name\": \"Portugu\\u00eas\"}, {\"id\": \"106059522759137\", \"name\": \"English\"}], \"location\": {\"id\": \"107911285910314\", \"name\": \"Coimbra, Portugal\"}, \"image_thumb\": \"https://graph.facebook.com/me/picture?access_token=CAAJBUIp6Nj0BABU9BmCZBbpx9hn9EjXmKwwGUlUdEFtjwnHdDLC9MghVCabDGjTg6JB7nP2e87NhioMeYqtKuxRtpBR5T4gEx4sW4hjgzl2O7lbYHQSWBPG58Vy2pC2ew1jOMPm2ryAH6Rr3ZCFmZA7vTCd9fjuoj0uHr4jgLAju4cEUQOUEyFAF3M8B0AZD\", \"email\": \"thunderstruck_@live.com\", \"username\": \"JorgeDamasoGraca\", \"bio\": \"Hello, my name is Jorge and currently I have an uncontrolled obsession with The Who\\r\\n\\r\\nSou um pessoa simples com gostos simples, satisfa\\u00e7o-me com o melhor, nada mais, nada menos. Sou facilmente agradado mas muito dificilmente realizado, aprecio os pequenos detalhes da vida, regra geral aqueles a que quase ningu\\u00e9m d\\u00e1 valor mas que tanto conforto e felicidade podem trazer. Desde um cigarro durante a madrugada a uma ch\\u00e1vena de caf\\u00e9 ao fim do dia, desde Jazz \\u00e1s 2 a Rock N\' Roll noite dentro. Adoro o cheiro de livros novos e o som de melodias nunca antes ouvidas, sou apaixonado pelas frias manh\\u00e3s de inverno e pelo calor que emana de uma fogueira numa qualquer praia numa dessas noites de ver\\u00e3o. Sou arrogante, sarc\\u00e1stico e at\\u00e9 cruel mas ao mesmo tempo sou atencioso, camarada e humano. Tenho muitos defeitos e talvez a minha maior qualidade seja mesmo t\\u00ea-los, pois o que n\\u00e3o s\\u00e3o os defeitos sen\\u00e3o caracter\\u00edsticas \\u00fanicas que nos marcam a n\\u00f3s e nos outros, n\\u00e3o o sendo necessariamente maus em todos os momentos. Gosto de aproveitar a vida at\\u00e9 ao mais \\u00ednfimo pormenor ainda que isso implique olhar durante horas a fio para a mesma paisagem... A vida \\u00e9 uma efemeridade nascida da impossibilidade de se ser, aproveita-a e n\\u00e3o sejas mais um amontoado de \\u00e1tomos sem utilidade\", \"birthday\": \"06/23/1991\", \"link\": \"http