	(750,98,120,'40.20494938332823,-8.404224550170966','Nomes de Rotundas, Gastão Cruz','As rotundas são pontos de referência, mas carecem de designação e de signos específicos. Podem ter nomes de escritores contemporâneos associados a uma árvore (como elemento decorativo) sobre a qual o determinado escritor tenha escrito. Ex:\nROTUNDA DOS CASTANHEIROS -  GASTÃO CRUZ\nos castanheiros a folhagem árida/\njá desce no ar morto que se move/\ndentro da palidez do céu de outono/\nsobre as aves imóveis//\n\nMovem-se as folhas só na tarde escassa/\nde clareiras do sol     movem-se as aves/\nextintas do outono/\ndentro dele e do sol//\n\nque mais que as aves mortas sob as árvores/\nse move/\ne movem-se aves/\n\nmais do que as folhas que do alto caem/\nmas sem sol grande as aves/ não se movem/\nnem já não caem com a calma as aves/\n',1,0,'','2014-06-16 10:43:48','2014-06-16 10:43:48',0),
	(825,53,105,'40.198836350797286,-8.408301507873603','Passadeira não visivel','Passadeira existente num cruzamento o Bairro Norton de Matos não se encontra visível, podendo causar acidentes, visto os automobilistas não conseguirem perceber que existe uma passadeira.',1,0,'','2014-07-18 14:31:59','2014-07-18 14:31:59',0),
	(826,53,69,'40.197099034540976,-8.40385976974494','Passeio invadido por vegetação','Passeio invadido por vegetação em zona nova da cidade. ',1,1,'','2014-07-18 14:35:46','2014-07-18 14:35:46',0),
	(827,53,114,'40.189739531504635,-8.401520883483954','Desmoronamento de um talude','Queda de uma parte de um murro para o passeio. Embora não parece muito grande se fosse um criança o utilizador do passeio podia causar danos graves.',1,1,'','2014-07-18 14:39:25','2014-07-18 14:39:25',0),
	(875,1,81,'37.32906944, -122.01978829','Teste iphone','Novo teste',0,0,'','2014-09-28 22:27:10','2014-09-28 22:27:10',0),
	(755,98,120,'40.20488383094341,-8.401070272369452','Rotundas com nomes Joaquim M. Magalhães','As rotundas são pontos de referência, mas carecem de designação e de signos específicos. Podem ter nomes de escritores contemporâneos associados a uma árvore (como elemento decorativo) sobre a qual o determinado escritor tenha escrito. Ex: ROTUNDA DOS CEDROS - JOAQUIM MANUEL MAGALHÃES Fogo, Felpa, Farmacopeia\nA noite ficou branca uma vez mais./ Nesse luar vazio floresce a rocha,/ a silva, o contorno do que nada acolhe. (...) Esmago as folhas da hortelã-brava,/ um odor carnívoro que se mistura/ à bruma roída dos barcos na lagoa./ Tudo/ tarde nas toalhas que nos limpam,/ o sândalo deitado nos lençóis,/ a linfa da estopa escura contra a luz. (...) A minha avó/ deu-me depois esta cadeira. Só lhe mudei/ a lona./ Apenas mudei eu. O pano cru/ com a amarga simplicidade de tudo./ Cedro a cedro, a violência do que vai/ diante de nós, dentro de mim./ Numa selha de zinco davam-me banho/e cantavam para eu não chorar,/ é lá possível não chorar.\n',1,0,'','2014-06-16 16:59:42','2014-06-16 16:59:42',0),
	(756,98,120,'40.20751407062631,-8.404299652023383','Rotundas e nomes Fiama','As rotundas são pontos de referência, mas carecem de designação e de signos específicos. Podem ter nomes de escritores contemporâneos associados a uma árvore (como elemento decorativo) sobre a qual o determinado escritor tenha escrito. Ex: ROTUNDA DOS ABETOS - FIAMA HASSE PAIS BRANDÃO\nQuando eu vir vaguear por dentro da casa/ o abeto que cresceu no bosque, hei-de/ ajoelhar no soalho. Todas as coisas/ comunicam entre si a totalidade das suas formas./ A mão que vai surgir do abeto apontará para mim.//\n\nTenho de despir as tiras de brocado que envolvem as veias/,\nas cadeias de ouro dos rins. Deixar/ que as unhas longas da árvore passem/ entre mim e o imo dos quartos interiores da casa.//\n\nSe essa figura imponente, a árvore, me reconhecer,/ vou interromper o que escrevo, esperar ansiosa/ atracção que a insónia desse vulto/ há - de exercer sobre mim. Rodo/ até à tontura da morte./ Torturo-me\naté à alegria. ',1,1,'','2014-06-16 17:43:34','2014-06-16 17:43:34',0),
	(859,53,79,'40.18590375009958,-8.416562711639472','Ausência de armadura do candeeiro','Ausência de armadura do candeeiro, deixando assim expostos os fios que servem de ligação da lâmpada.',1,0,'','2014-07-24 15:05:58','2014-07-24 15:05:58',0),
	(860,53,79,'40.18608406946879,-8.416627084655829','Ausência dos Candeeiros ','Ausência de candeeiros no parque de estacionamento. ',1,0,'','2014-07-24 15:09:02','2014-07-24 15:09:02',0),
	(861,53,67,'40.18583486279335,-8.416823689994771','Ausência de grelhada','No fim/inicio de umas escadas, encontra-se um buraco pelo facto de a grelha lá existente ter desaparecido.\nTorna-se perigo para quem frequenta o local, pois pode cair. E dificulta a drenagem visto existir uma enorme acumulação de lixo no local.',1,0,'','2014-07-24 15:12:27','2014-07-24 15:12:27',0),
	(863,53,113,'40.184498107249084,-8.415723819961613','Paragem de autocarro tapada por vegetação','Paragem de autocarro, tapada por vegetação. Quem não conhecer não se aperceber da existência de uma paragem de autocarro no local',1,0,'','2014-07-24 15:16:33','2014-07-24 15:16:33',0),
	(864,53,66,'40.18471646619658,-8.411635476074252','Pavimento muito degradado','Pavimento muito degradado, com a invasão da vegetação para a faixa de rodagem. Provocando má visibilidade para os condutores.',1,0,'','2014-07-24 15:18:41','2014-07-24 15:18:41',0),
